import React from 'react';
import {Router, Route} from 'react-router';

import Home from "./Home/homepage.jsx";

function App() {
  return (
    <Router>
      <header>
        <nav>
            <ul>
                <li>
                    <a href="/">Home</a>
                </li>
            </ul>
        </nav>
      </header>
        <Route path="/" component={Home}></Route>
    </Router>
  );
}

export default App;
